--------------------------------------------------------
--  DDL for View SELECT_TEMPS
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SELECT_TEMPS" ("CODE", "LIB_TEMPS", "ORDRE") AS 
  SELECT TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))||'_1_'||TO_NUMBER(TO_CHAR(SYSDATE,'YYYY')) AS CODE_TEMPS,TO_CHAR(SYSDATE,'YYYY') AS LIB_TEMPS,0 AS ORDRE FROM DUAL 
UNION ALL
SELECT ANNEE||'_4_'||MOIS,' '||LIB_MOIS||' ('||ANNEE||')',MOIS from DIM_TEMPS 
WHERE ANNEE=TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))
UNION ALL
SELECT DISTINCT ANNEE||'_3_'||TRIMESTRE,' Trimestre '||TRIMESTRE||' ('||ANNEE||')',12+TRIMESTRE from DIM_TEMPS 
WHERE ANNEE=TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))
UNION ALL
SELECT DISTINCT ANNEE||'_2_'||SEMESTRE,' Semestre '||SEMESTRE||' ('||ANNEE||')',16+SEMESTRE from DIM_TEMPS 
WHERE ANNEE=TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))
UNION ALL
SELECT TO_CHAR(TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))-1)||'_1_'||TO_CHAR(TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))-1) ,TO_CHAR(TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))-1) ,20  FROM DUAL 
UNION ALL
SELECT ANNEE||'_4_'||MOIS,' '||LIB_MOIS||' ('||ANNEE||')',20+MOIS from DIM_TEMPS 
WHERE ANNEE=TO_NUMBER(TO_CHAR(SYSDATE,'YYYY'))-1
UNION ALL
