--  DDL for Procedure SYNCHRO_ID_DEPARTEMENT_SEQ
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "SYNCHRO_ID_DEPARTEMENT_SEQ" 
AS
  IdDepartementCompteur DIM_DEPARTEMENT.ID_DEPARTEMENT%TYPE;
  seqcount integer;
BEGIN
  SELECT MAX(ID_DEPARTEMENT)+ 1 INTO IdDepartementCompteur
  FROM DIM_DEPARTEMENT;
    IF IdDepartementCompteur IS NULL THEN
    IdDepartementCompteur:=1;
  END IF;
  SELECT COUNT(*) INTO seqCount FROM user_sequences WHERE sequence_name='ID_DEPARTEMENT_SEQ';
  IF seqcount=1 THEN
    execute immediate 'DROP SEQUENCE ID_DEPARTEMENT_SEQ' ;
  END IF;
  execute immediate 'CREATE SEQUENCE ID_DEPARTEMENT_SEQ START WITH '||IdDepartementCompteur|| ' INCREMENT BY 1';
END;

/

/
