  CREATE OR REPLACE EDITIONABLE PROCEDURE "SYNCHRO_ID_DEVISE_SEQ" 
AS
  IdDeviseCompteur DEVISE.ID_DEVISE%TYPE;
  seqcount integer;
BEGIN
  SELECT MAX(ID_DEVISE)+ 1 INTO IdDeviseCompteur
  FROM DEVISE;
